import React, { Component } from 'react';
import "./index.css";

class Shirt extends Component {
  render() {
    return (
      <div className="contentDiv">
        <p id="shirtTitle">T-Shirt Design</p>
        <p>
          Do you have a great sense of fashion? Do you find yourself constantly starting new fashion trends
          around school or work? Do you have absolutely nothing else to do? Do you enjoy saving money? Then the T-Shirt Design
          contest for Winter Retreat 2018 is just for you! Enter your unique and original design for the Winter Retreat 2018
          official shirt. The winner's design will be used and they will also save $24,500 off of the registration fee!
        </p>
        <div className="row">
          <div className="col s12 m6">
            <p><span id="break">|&nbsp;</span><span>Rules:</span></p>
            <p>
              Winter Retreat 2018 is quite simply the absolute best thing you can do to end 2018. Come and join brothers and sisters in Christ for
              an absolutely incredible time of fellowship, prayer, praise, intimacy and growth. There will be messages from the Word, praise music,
              intimate small groups, fun group games and activities, and of course amazing fine dining. It is also a great time to make friends as well, so if you
              completely don't know anyone who is going, you are sure to come back with exponentially more friends than when you first arrived.
              <br></br>
              "Winter Retreat is the greatest thing I have ever experienced" - every person who ever attended, 2017
            </p>
          </div>
          <div className="col s12 m6">
          </div>
        </div>
      </div>
    )
  };
};

export default Shirt;
